IF OBJECT_ID('dbo.proc_transform_461', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_461;
GO
CREATE PROCEDURE dbo.proc_transform_461
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_461
    SET payload = LEFT(payload, 1000) + N'|V4-461|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_461;
END
